import React from 'react';
import styles from '../styles/Resume.module.css';

const Resume = () => {
    const education = [
        {
            degree: "Grado en Ingeniería de la Salud",
            institution: "Universidad de Málaga",
            period: "2020 - 2024",
            description: "Especialización en tecnologías sanitarias, análisis de datos en salud y sistemas de información hospitalarios."
        }
    ];

    const experience = [
        {
            title: "Proyecto Final de Grado",
            company: "Universidad de Málaga",
            period: "2024",
            description: "Desarrollo de un modelo de clasificación de imágenes de resonancia magnética para la detección de patrones asociados al Alzheimer utilizando redes neuronales convolucionales."
        },
        {
            title: "Proyecto de Data Warehouse",
            company: "Colaboración Académica",
            period: "2023",
            description: "Diseño e implementación de un sistema de análisis de datos hospitalarios en EE.UU. utilizando pipelines ETL, cubos OLAP y dashboards interactivos en Power BI."
        }
    ];

    const skills = [
        {
            category: "Programación",
            items: ["Python", "R", "Java", "C#", "Spring Boot", "Angular"]
        },
        {
            category: "Data Science & ML",
            items: ["TensorFlow", "PyTorch", "Scikit-learn", "Pandas", "NumPy", "Matplotlib"]
        },
        {
            category: "Bases de Datos",
            items: ["SQL Server", "MySQL", "MongoDB", "Elasticsearch"]
        },
        {
            category: "Herramientas",
            items: ["Power BI", "Apache NiFi", "Git", "Postman", "Linux"]
        }
    ];

    return (
        <div className={styles.resumePage}>
            <div className={styles.container}>
                <div className={styles.resumeHeader}>
                    <h1 className={styles.pageTitle}>Resume</h1>
                    <p className={styles.subtitle}>Mi trayectoria académica y profesional</p>

                    <div className={styles.downloadSection}>
                        <a 
                            href="/cv.pdf" 
                            target="_blank" 
                            rel="noopener noreferrer"
                            className={styles.downloadButton}
                        >
                            <i className="fas fa-download"></i>
                            Descargar CV Completo
                        </a>
                    </div>
                </div>

                <div className={styles.resumeContent}>
                    {/* EDUCACIÓN */}
                    <section className={styles.resumeSection}>
                        <h2 className={styles.sectionTitle}>
                            <i className="fas fa-graduation-cap"></i>
                            Educación
                        </h2>
                        <div className={styles.timelineContainer}>
                            {education.map((item, index) => (
                                <div key={index} className={styles.timelineItem}>
                                    <div className={styles.timelineMarker}></div>
                                    <div className={styles.timelineContent}>
                                        <h3 className={styles.itemTitle}>{item.degree}</h3>
                                        <h4 className={styles.itemSubtitle}>{item.institution}</h4>
                                        <span className={styles.itemPeriod}>{item.period}</span>
                                        <p className={styles.itemDescription}>{item.description}</p>
                                    </div>
                                </div>
                            ))}
                        </div>
                    </section>

                    {/* EXPERIENCIA */}
                    <section className={styles.resumeSection}>
                        <h2 className={styles.sectionTitle}>
                            <i className="fas fa-briefcase"></i>
                            Experiencia y Proyectos
                        </h2>
                        <div className={styles.timelineContainer}>
                            {experience.map((item, index) => (
                                <div key={index} className={styles.timelineItem}>
                                    <div className={styles.timelineMarker}></div>
                                    <div className={styles.timelineContent}>
                                        <h3 className={styles.itemTitle}>{item.title}</h3>
                                        <h4 className={styles.itemSubtitle}>{item.company}</h4>
                                        <span className={styles.itemPeriod}>{item.period}</span>
                                        <p className={styles.itemDescription}>{item.description}</p>
                                    </div>
                                </div>
                            ))}
                        </div>
                    </section>

                    {/* HABILIDADES */}
                    <section className={styles.resumeSection}>
                        <h2 className={styles.sectionTitle}>
                            <i className="fas fa-cogs"></i>
                            Habilidades Técnicas
                        </h2>
                        <div className={styles.skillsGrid}>
                            {skills.map((skillGroup, index) => (
                                <div key={index} className={styles.skillGroup}>
                                    <h3 className={styles.skillCategory}>{skillGroup.category}</h3>
                                    <div className={styles.skillTags}>
                                        {skillGroup.items.map((skill, skillIndex) => (
                                            <span key={skillIndex} className={styles.skillTag}>
                                                {skill}
                                            </span>
                                        ))}
                                    </div>
                                </div>
                            ))}
                        </div>
                    </section>
                </div>
            </div>
        </div>
    );
};

export default Resume;
